import React, { Component } from 'react'
import { Route, Switch } from 'react-router'

export default class StudentPageRoute extends Component {
    render() {
        return (
            <div>
                <Switch>
                <Route path="/student/home" component={Home}/>
                <Redirect to="/student/home"/>
                </Switch>
            </div>
        )
    }
}
